import { Routes, Route } from "react-router-dom";
import LogIn from './Pages/duringLogIn/LogIn/LogIn';
import AllMedics from './Pages/beforeLogIn/Medics/AllMedics';
import AllServices from './Pages/beforeLogIn/Services/AllServices';
import OpeningHours from './Pages/beforeLogIn/OpeningHours/OpeningHours';
import Home from './Pages/beforeLogIn/Home/Home';
import Contact from './Pages/beforeLogIn/Contact/Contact';
import LayoutBeforeLogIn from './Pages/beforeLogIn/Layout_Before_LogIn/Layout_Before_LogIn';
import signUp from "./Pages/duringLogIn/SignUp/SignUp";
import ForgotPassword from "./Pages/duringLogIn/forgotPass/ForgotPassword";
import SignUp from "./Pages/duringLogIn/SignUp/SignUp";

function App() {
    return (
        <Routes>
            <Route
                path="/"
                element={
                    <LayoutBeforeLogIn>
                       <Home />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="medics/*"
                element={
                    <LayoutBeforeLogIn>
                       <AllMedics />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="services/*"
                element={
                    <LayoutBeforeLogIn>
                       <AllServices />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="opening-hours"
                element={
                    <LayoutBeforeLogIn>
                        <OpeningHours />
                    </LayoutBeforeLogIn>
                }
            />
            <Route
                path="Contact"
                element={
                    <LayoutBeforeLogIn>
                        <Contact />
                    </LayoutBeforeLogIn>
                }
            />
            <Route path="log-in" element={<LogIn />} />
            <Route path="log-in" element={<ForgotPassword />} />
            <Route path="log-in" element={<SignUp />} />
        </Routes>
    );
}

export default App;
